import { Component } from '@angular/core';
import { FormBuilder } from '@angular/forms';

@Component({
  selector: 'app-login-page',
  templateUrl: './login-page.component.html',
  styleUrls: ['./login-page.component.css']
})
export class LoginPageComponent {
  loginForm = this.formBuilder.group({
    login: '',
    password: ''
  });

  constructor(private formBuilder: FormBuilder) { } 

  onSubmit(): void {
    console.warn('Your order has been submitted', this.loginForm.value);
  }
}
<p>login-page works!</p>
<form [formGroup]="loginForm" (ngSubmit)="onSubmit()">
  <div class="login-form">
    <mat-form-field appearance="fill">
      <mat-label>Fill form field</mat-label>
      <input id="login" type="text" matInput placeholder="Login" formControlName="login">
    </mat-form-field>
    <mat-form-field appearance="fill">
      <mat-label>Outline form field</mat-label>
      <input id="password" type="password" matInput placeholder="Hasło" formControlName="password">
    </mat-form-field>
  </div>
  <button mat-raised-button type="submit">Zaloguj</button>
</form>
